import React, { Component } from 'react';


class Counter extends Component {

    state = {
        count: 0
    };

    render() { 
        return (
        <React.Fragment>
            <span>{this.state.count}</span>
            <button>Increase</button>
        </React.Fragment>
        );
    }
}

export default Counter;
